import { greenColors } from "./MapStyles";
import { Dict } from "../types/types";

export const appColors: string[] = [
    'rgba(241,241,241,1)',
    'rgba(0,53,96,1)',
    'rgba(141,174,16,1)',
];

export const AppLayout: Dict = {
    borderWidth: 5,
    border: `5px solid ${greenColors[6]}`,
    columnHeight: '50vh',
}
